CommandSet.JavascriptSDKCode:
exports.processResponse = function(data, d, sdk){
    var s = data.toString();
    var lines = s.split("\r\n");

lines.forEach(function(dataString){


if(dataString.contains("(S#I2=")){
    var y = dataString.split("=");
    var CurrentInput = y[1].replace(")","");
    var CurrentSource = CurrentInput;

if(CurrentInput == "HDMI")
    CurrentInput = "1";
if(CurrentInput == "DP")
    CurrentInput = "0";
if(CurrentInput == "DVI")
    CurrentInput = "2";
if(CurrentInput == "VGA")
    CurrentInput = "3";
    

    sdk.setGlobalVariableValue("CurrentSource", CurrentSource);
    sdk.setGlobalVariableValue("CurrentInput", CurrentInput);

    sdk.logMessage(CurrentInput);
}

if(dataString.contains("(PS ")){
    sdk.executeMacro("QueryStatus");
}

if(dataString.contains("(PSC)")){
    sdk.executeMacro("QueryStatus");
}

//INPUT BOARDS//

if(dataString.contains("SL# 1")){
    var a = dataString.split(" ");
    var b = a[2];
    var c = b.split("-");
    var out18 = c[1];
 //       sdk.logMessage(out18);
        sdk.setDeviceVariableValue(d,"out18", out18);      
}

if(dataString.contains("SL# 2")){
    var a2 = dataString.split(" ");
    var b2 = a2[2];
    var c2 = b2.split("-");
    var out916 = c2[1];
 //       sdk.logMessage(out916);
        sdk.setDeviceVariableValue(d,"out916", out916);      
}

if(dataString.contains("SL# 3")){
    var a3 = dataString.split(" ");
    var b3 = a3[2];
    var c3 = b3.split("-");
    var out1724 = c3[1];
 //       sdk.logMessage(out1724);
        sdk.setDeviceVariableValue(d,"out1724", out1724);      
}

if(dataString.contains("SL# 4")){
    var a4 = dataString.split(" ");
    var b4 = a4[2];
    var c4 = b4.split("-");
    var out2532 = c4[1];
 //       sdk.logMessage(out2532);
        sdk.setDeviceVariableValue(d,"out2532", out2532);      
}

//OUTPUT BOARDS//

if(dataString.contains("SL# 51")){
    var e = dataString.split(" ");
    var f = e[2];
    var g = f.split("-");    
    var in18 = g[1];
            
 //       sdk.logMessage(in18);
        sdk.setDeviceVariableValue(d,"in18", in18);      
}

if(dataString.contains("SL# 52")){
    var e2 = dataString.split(" ");
    var f2 = e2[2];
    var g2 = f2.split("-");
    var in916 = g2[1];
            
 //       sdk.logMessage(in916);
        sdk.setDeviceVariableValue(d,"in916", in916);
}

if(dataString.contains("SL# 53")){
    var e3 = dataString.split(" ");
    var f3 = e3[2];
    var g3 = f3.split("-");
    var in1724 = g3[1];
            
 //       sdk.logMessage(in1724);
        sdk.setDeviceVariableValue(d,"in1724", in1724);      
}

if(dataString.contains("SL# 54")){
    var e4 = dataString.split(" ");
    var f4 = e4[2];
    var g4 = f4.split("-");
    var in2532 = g4[1];
            
  //      sdk.logMessage(in2532);
        sdk.setDeviceVariableValue(d,"in2532", in2532);      
}


//PORT STATUS INPUT //

if(dataString.contains("(PS ")){
    var alpha = dataString.split(",");
    
 //   sdk.logMessage(alpha[0]);
 //   sdk.logMessage(alpha[1]);
    
    //Port Status Input
    var sigma = alpha[0];

    for(var i = 4; i < sigma.length; i++){
        var inputNumber = i - 3;
        var variableName = "input" + inputNumber;
        
        var connected = "Error";
        var input = sigma[i];
        if(input == "F" || input == "7" || input == "3" || input == "6" || input == "E" || input == "B")
            connected = "Connected";
        
        
        sdk.setDeviceVariableValue(d, variableName, connected);
        

        

    
    }


    //Port Status Output
    var pi = alpha[1];
    for(var i = 0; i < pi.length - 1; i++){
        var outputNumber = i + 1;
        var variableName = "output" + outputNumber;
        
        var connected = "Error";
        var output = pi[i];
        if(output == "F" || output == "7" || output == "3" || output == "6" || output == "E" || output =="1")
            connected = "Connected";
        
        
        sdk.setDeviceVariableValue(d, variableName, connected);
    }

}


//HDMI IN//

if(dataString.contains("(HDMI#") && dataString.contains("@SI")){
    var prompts =  dataString.split(";");
    var item1 = prompts[0].split("=");
    var input = item1[0].replace("(HDMI#", "").replace("@SI", "");
    var variableName = "hdmiDVIin" + input + "Res";
    
    var hdmiResIn = prompts[1];
    var omegaIn = hdmiResIn.split(",");
    var deltaIn = omegaIn[0];
    var resolution = deltaIn.replace("V","");
    if(deltaIn == "E2000" || deltaIn == "PA1" || deltaIn == "E1000" || deltaIn == "E0000" || deltaIn == "E2001")
        resolution = "No Signal";
    sdk.setDeviceVariableValue(d, variableName, resolution);
}



//HDMI OUT//

if(dataString.contains("(HDMI#") && dataString.contains("@SO")){
    var promptsOut =  dataString.split(";");
    var out1 = promptsOut[0].split("=");
    var outputRes = out1[0].replace("(HDMI#", "").replace("@SO", "");
    var variableName = "hdmiDVIout" + outputRes + "Res";
    
    var hdmiResOut = promptsOut[1];
    var omegaOut = hdmiResOut.split(",");
    var deltaOut = omegaOut[0];
    var resolution = deltaOut.replace("V","");
    if(deltaOut == "E2000" || deltaOut == "PA1" || deltaOut == "E1000" || deltaOut == "E0000" || deltaOut == "E2001"|| deltaOut == "OAAAAA")
        resolution = "No Signal";
    sdk.setDeviceVariableValue(d, variableName, resolution);

}





//TPS IN//

if(dataString.contains("(TPS#") && dataString.contains("@SI")){
    var tpsIn =  dataString.split(";");
    var tpsInput = tpsIn[0].split("=");
    var inputNum = tpsInput[0].replace("(TPS#", "").replace("@SI", "");
    var variableName = "tpsIn" + inputNum;
  
var tpsState = tpsIn[2];
    var state = tpsState;
if(state == "0")
    state = "No PWR/LAN";
if(state == "H")
    state = "HD BaseT";
if(state == "2")
    state = "Low PWR RS232+Eth";
if(state == "E")
    state = "Ethernet Fallback";
if(state == "1")
    state = "Low PWR RS232 Only";

    sdk.setDeviceVariableValue(d, variableName, state);
 //   sdk.logMessage(state);
}



//TPS OUT//

if(dataString.contains("(TPS#") && dataString.contains("@SO")){
    var tpsOut =  dataString.split(";");
    var tpsOutput = tpsOut[0].split("=");
    var outNum = tpsOutput[0].replace("(TPS#", "").replace("@SO", "");
    var variableName = "tpsOut" + outNum;
  
var tpsOutState = tpsOut[2];

    var outState = tpsOutState;
if(outState == "0")
    outState = "No PWR/LAN";
if(outState == "H")
    outState = "HD BaseT";
if(outState == "2")
    outState = "Low PWR RS232+Eth";
if(outState == "E")
    outState = "Ethernet Fallback";
if(outState == "1")
    outState = "Low PWR RS232 Only";

    sdk.setDeviceVariableValue(d, variableName, outState);
//    sdk.logMessage(outState);
}

if(dataString.contains("(ALL ")){
    var z = dataString.split(" ");
    var x = z[1];
    var j = x.replace("0","");
    var out1 = "Input " + j;
    
    sdk.setGlobalVariableValue("Out1",out1);
    
}

if(dataString.contains("(ALL ")){
    var z = dataString.split(" ");
    var x = z[1];
    var j = x.replace("0","");
    var out2 = "Input " + j;
    
    sdk.setGlobalVariableValue("Out2",out2);
    
}

if(dataString.contains("(ALL ")){
    var z = dataString.split(" ");
    var x = z[1];
    var j = x.replace("0","");
    var out3 = "Input " + j;
    
    sdk.setGlobalVariableValue("Out3",out3);
    
}

if(dataString.contains("(ALL ")){
    var z = dataString.split(" ");
    var x = z[1];
    var j = x.replace("0","");
    var out4 = "Input " + j;
    
    sdk.setGlobalVariableValue("Out4",out4);
    
}

if(dataString.contains("(ALL ")){
    var z = dataString.split(" ");
    var x = z[1];
    var j = x.replace("0","");
    var out5 = "Input " + j;
    
    sdk.setGlobalVariableValue("Out5",out5);
    
}

if(dataString.contains("(ALL ")){
    var z = dataString.split(" ");
    var x = z[1];
    var j = x.replace("0","");
    var out6 = "Input " + j;
    
    sdk.setGlobalVariableValue("Out6",out6);
    
}

if(dataString.contains("(ALL ")){
    var z = dataString.split(" ");
    var x = z[1];
    var j = x.replace("0","");
    var out7 = "Input " + j;
    
    sdk.setGlobalVariableValue("Out7",out7);
    
}

if(dataString.contains("(ALL ")){
    var z = dataString.split(" ");
    var x = z[1];
    var j = x.replace("0","");
    var out8 = "Input " + j;
    
    sdk.setGlobalVariableValue("Out8",out8);
    
}

if(dataString.contains("(PS ")){
    var vMacro = sdk.getGlobalVariableValue("Macro");
    var vLightware_hdmiDVIin2Res = sdk.getGlobalVariableValue("Lightware _hdmiDVIin2Res");

if(vLightware_hdmiDVIin2Res == "640x480p60" && vMacro == "0")
    sdk.executeMacro("SwitchToBackup");
else{
    sdk.executeMacro("SwitchToOriginal");
    
    sdk.logMessage(vMacro);

}
}




}
);
};
